import{_ as e,c as a,o as s,a as t}from"./app.a6ee8b6d.js";const f=JSON.parse('{"title":"","description":"","frontmatter":{},"headers":[{"level":2,"title":"Breach","slug":"breach","link":"#breach","children":[]}],"relativePath":"faq/86.md"}'),i={name:"faq/86.md"},r=t('<h2 id="breach" tabindex="-1">Breach <a class="header-anchor" href="#breach" aria-hidden="true">#</a></h2><p>tags: breach, elemental breach, physical breach, ele breach, phys breach</p><p>Understanding Elemental Breach (&quot;\u5143\u7D20\u7A7F\u900F&quot;)</p><ol><li>Enemies have ele resist. Most Ex MA bosses have 31%. Jizo has 72%. 31% resist means 0.69 is multiplied to any dmg.</li><li>Ele Breach is reduction in ele resist, i.e. the number is directly subtracted from ele resist. AE has 14% Ele Breach, so bosses with 31% ele resist have 17% ele resist after 14% Ele Breach.</li><li>To illustrate the impact of Ele Breach, 31% ele resist with 14% Ele Breach results in 83 / 69 = 1.203 times more damage. 72% ele resist with 14% Ele Breach results in 42 / 28 = 1.5 times more damage. In summary, damage increase as a result of having Ele Breach is Ele Breach / (1 - ele resist)</li><li>Each source of Ele Breach is subtracted from ele resist. For example, 14% from AE Ult and 20% from HR Ult (total 34%) results in Jizo having 38% ele resist and bosses with 31% ele resist having 0 ele resist. Note that ele resist cannot be negative, so Ele Breach is no longer useful once ele resist has been reduced to 0.</li></ol><p>Understanding Physical Breach (&quot;\u7269\u7406\u7A7F\u900F&quot;)</p><ol><li>Physical Breach is, at the time of writing, a concept only available in Elysian Realm.</li><li>Physical Breach does not behave like Ele Breach. Based on testing, it is the same as Impair. See &quot;!faq impair&quot;.</li><li>My best guess for why Physical Breach exists in addition to Impair is that historically Impair has been single instance instead of stacking, so they introduced a different name to show this difference.</li></ol>',6),l=[r];function o(n,c,h,d,m,u){return s(),a("div",null,l)}const p=e(i,[["render",o]]);export{f as __pageData,p as default};
